import React, { Component } from 'react';
import './App.css';
import Header from './component/header/header';
import Footer from './component/footer/footer';
import User from './component/main/user';

class App extends Component {
  render() {
    return (
      <div className="App">
          <header>
              <Header/>
          </header>
          <User />
          <Footer/>
      </div>
    );
  }
}

export default App;
